import React from "react";
import Contact from "./Contact";
function Footer() {
    return (
        <div id="footer">
            <a href="https://www.linkedin.com/in/racheal-ogundipe/"> Linkedin </a>            
            <p id="footer">Adeola Ogundipe
            <p id="footer">Contact Information            
            <Contact />           
            </p> </p>  
        </div>
    );
}

export default Footer;
